import json
import re

def convert_to_turtle(obj):
    obj['id'] = re.sub(r'\$', '_', obj['id'])
    turtle_template = """
ex:{id} a ex:IfcWallStandardCase ;
    ex:depth "{depth}"^^xsd:double ;
    ex:width "{width}"^^xsd:double ;
    ex:height "{height}"^^xsd:double ;
    ex:x "{x}"^^xsd:double ;
    ex:y "{y}"^^xsd:double ;
    ex:z "{z}"^^xsd:double ;
    geo:hasGeometry ex:Geometry_{id} .
"""
    return turtle_template.format(**obj)

